import './App.css';

function App() {
  return (
    <div className="App">
      <div className="datos">
        <label>ID trabajador: <input type="text"></input></label> <br/>
        <label>Nombre completo del contacto: <input type="text"></input></label> <br/>
        <label>Dirección del contacto<input type="text"></input></label> <br/>
        <label>Localidad del contacto: <input type="text"></input></label> <br/>
        <label>Provincia del contacto: <input type="text"></input></label> <br/>
        <label>Teléfono de contacto: <input type="text"></input></label> <br/>
        <label>Observaciones del contacto: <input type="text"></input></label>
      </div>
    </div>
  );
}

export default App;
